import React from "react";
import Slider from "react-slick";
import Card from "../cart/card";
import team1 from "../../assests/Free-Creative.png";
import team2 from "../../assests/content-icon.webp";
import team3 from "../../assests/handsome-white.png";

const teams = [
  {
    image: team1,
    name: "Muhammad Bilal",
    description: "CO Founder & CEO",
  },
  {
    image: team2,
    name: "Iqra bilal",
    description: "Social media Marketing Manager",
  },
  {
    image: team3,
    name: "Muhammad Hassan",
    description: "Senior Graphic designer",
  },
  {
    image: team1,
    name: "Ali Ahmad",
    description: "Senior Frontend developer",
  },
  {
    image: team2,
    name: "Sara Khan",
    description: "Project Manager",
  },
];

const Team = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 600,
    slidesToShow: 3,
    slidesToScroll: 1,
    responsive: [
      {
        breakpoint: 1024,
        settings: {
          slidesToShow: 2,
        },
      },
      {
        breakpoint: 640,
        settings: {
          slidesToShow: 1,
        },
      },
    ],
  };

  return (
    <div className="flex justify-center items-center w-full bg-white py-10">
      <div className="flex flex-col px-[30px] max-w-[1330px] w-full text-center mx-auto">
        <div className="mb-10">
          <span className="uppercase text-blue-500 font-semibold tracking-wide">
            Meet the leaders
          </span>
          <h1 className="text-4xl font-bold mt-2">The Best Team</h1>
          <p className="mt-4 text-gray-600">
            With our individualities, we share a common interest in the digital
            world and join hands to build a better virtual world of yours where
            you can stand out. Let us introduce the creative minds behind the
            name <strong>BURAQSYS Studio</strong>.
          </p>
        </div>

        <Slider {...settings}>
          {teams.map((item, index) => (
            <div key={index} className="px-3">
              <Card
                icon={item?.image}
                title={item?.name}
                description={item?.description}
              />
            </div>
          ))}
        </Slider>
      </div>
    </div>
  );
};

export default Team;
